webpackJsonp([92810488195291],{1034:function(l,n){l.exports={data:{markdownRemark:{html:'<p>主にゲーム向けのXNA GameStudio用フレームワークです。\n別に内部でなんか凄い処理を行っているわけではなく、それなりの規模のゲームを作るためには最低限必要だろう、と思われるアルゴリズムをまとめた程度の能力の物体です。\nちょっと古いですが、Flex SDK版もあります。\nぶっちゃけ海の向こうのお偉いさんが作ったでっかいフレームワークがよくわかんないくらいのあたまが⑨なプログラマ一なんでこんなのつくってみたってだけだったり～。</p>\n<h2>実績</h2>\n<ul>\n<li>(XNA)<a href="https://danmaq.com/products/apps/dnh/thc/">東方夢終劇</a>.NET プレ アルファ版</li>\n<li>(XNA)<a href="http://kagaminer.in/">結界幻想録 鏡</a>体験版</li>\n<li>(FLEX)タイトー「スペースパズルボブル」Web体験版Flash</li>\n<li>(FLEX)タイトー「スペースインベーダー エクストリーム 2」公式サイトFlash</li>\n</ul>\n<h2>動作環境(XNA)</h2>\n<ul>\n<li>Microsoft XNA GameStudio 3.1以降</li>\n<li>Microsoft XNA Framework 3.1以降</li>\n<li>上記が完全動作するハードウェア環境</li>\n</ul>\n<h2>動作環境(FLEX)</h2>\n<ul>\n<li>Adobe Flex SDK 3.2.0以降</li>\n<li>Adobe Flash Player 10.0.12以降(開発時はデバッグ版を推奨)</li>\n</ul>\n<h2>ダウンロード</h2>\n<ul>\n<li><a href="http://sourceforge.jp/projects/nineball/releases/">Stable build PACKAGE(ちょっと古い・安定版)</a></li>\n<li><a href="http://svn.sourceforge.jp/view/trunk/?root=nineball">Weekly build SOURCE(最新・不安定版)</a></li>\n<li><a href="http://svn.sourceforge.jp/svnroot/nineball/">Weekly build SOURCEのSVNリポジトリ(readonly)</a></li>\n</ul>',frontmatter:{cover:null,date:"2008-09-01T00:00:00+09:00",strDate:"2008/8/31",redirect:null,title:"danmaq Nineball Library",youtube:null},fields:{langKey:"ja",slug:"/ja/p/n/nineball-library/"}},site:{siteMetadata:{langKeyDefault:"ja",langs:["ja","en"]}}},pathContext:{path:"/ja/p/n/nineball-library/",langKey:"ja"}}}});
